import { Paper,Grid  } from "@mui/material";
import React from "react";
import GuardDashboard from './GuardDashboard';
import imgPath from "./Images/iiit-bangalore.jpg"
const GuardLandingPage =() =>
{
    return(
        <>
        <GuardDashboard/>
        <img src={imgPath} style={{ display: "block", margin: "auto",width: { xs: "100%", sm: "100%" }, height: { xs: 70, sm: 90 }, textAlign: "center", verticalAlign: "middle"}} />

        </>
    )
}

export default GuardLandingPage;
